import "./Catalog.css";

import ProductCard from "../ProductCard/ProductCard.js";

function Catalog(props) {
    // products eh um array com os produtos dessa secao
    const { catalogType, products } = props;

    return (
        <article className={`allProductsCatalog ${catalogType}`}>
            {products.map((product, index) => (
                <ProductCard 
                    key={product.id}
                    image={product.image}
                    name={product.name}
                    price={product.price}
                    sizes={product.sizes}
                />
            ))}
        </article>
    );
}

export default Catalog;
